-- ----------------------------
-- Table structure for sys_department
-- ----------------------------
DROP TABLE IF EXISTS `sys_department`;
CREATE TABLE `sys_department` (
  `id` bigint NOT NULL COMMENT '主键id',
  `ids` varchar(255) DEFAULT NULL COMMENT 'ids, 逗号隔开',
  `parent_id` bigint DEFAULT '0' COMMENT '父级id',
  `enterprise_id` bigint DEFAULT '1' COMMENT '企业/机构id',
  `department_name` varchar(50) DEFAULT '' COMMENT '部门名称',
  `department_code` varchar(50) DEFAULT '' COMMENT '部门编号',
  `manager_name` varchar(50) DEFAULT '' COMMENT '负责人名称',
  `manager_phone` varchar(50) DEFAULT '' COMMENT '负责人手机号',
  `manager_email` varchar(50) DEFAULT '' COMMENT '负责人邮箱',
  `department_num` int DEFAULT '0' COMMENT '子部门数',
  `department_user_num` int DEFAULT '0' COMMENT '部门人员数',
  `is_enable` tinyint(1) DEFAULT '1' COMMENT '是否可用(0: 不可用, 1: 可用)',
  `level` int DEFAULT '0' COMMENT '部门等级',
  `remark` varchar(500) DEFAULT '' COMMENT '备注',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '是否删除，默认0（false）',
  `create_user_id` bigint DEFAULT '0' COMMENT '创建人id',
  `create_user_code` varchar(20) DEFAULT '' COMMENT '创建人编号',
  `create_user_name` varchar(50) DEFAULT '' COMMENT '创建人姓名',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user_id` bigint DEFAULT '0' COMMENT '修改人id',
  `update_user_code` varchar(20) DEFAULT NULL COMMENT '修改人编号',
  `update_user_name` varchar(50) DEFAULT '' COMMENT '修改人姓名',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `version` bigint DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='部门信息表';

